// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract EHR { 

  struct Record { 
    string cid;
    // address patientId;
    // address doctorId;
    string patientName;
    string doctorName;
    string symptoms;
    string diagnostic;
    uint256 timeAdded;
  }

  struct Patient {
    address id;
    string password;
    Record[] records;
  }

  struct Doctor {
    string name;
    string password;
  }

  mapping (address => Patient) public patients;
  mapping (address => Doctor) public doctors;
  address[] public doctorArray;
  address[] public patientArray;

  event PatientAdded(address indexed patientId);
  event DoctorAdded(address indexed doctorId);
  event RecordAdded(string indexed cid, address patientId, address doctorId); 

  // -------------------------------------------------------------------------------------------------------//

  // // modifiers
  // modifier senderExists {
  //   require(doctors[msg.sender].id == msg.sender || patients[msg.sender].id == msg.sender, "Sender does not exist");
  //   _;
  // }

  modifier patientExists(address patientId) {
    require(patients[patientId].id == patientId, "Patient does not exist");
    _;
  }

  // modifier senderIsDoctor {
  //   require(doctors[msg.sender].id == msg.sender, "Sender is not a doctor");
  //   _;
  // }

  // function addPatient(address _patientId) public senderIsDoctor{
  //   require(patients[_patientId].id != _patientId, "This patient already exists.");
  //   patients[_patientId].id = _patientId;
  //   patientArray.push(_patientId);

  //   emit PatientAdded(_patientId);
  // }


  // ---------------------------------------------------------------------------------------------- //




  // function addDoctor() public {
  //   require(doctors[msg.sender].id != msg.sender, "This doctor already exists.");
  //   doctors[msg.sender].id = msg.sender;

  //   emit DoctorAdded(msg.sender);
  // }

  // -------------------------------------------------///
  // function addDoctor(address _doctorId, string memory _password) public {
  //   require(doctors[_doctorId].id != _doctorId, "This doctor already exists.");
  //   doctors[_doctorId].id = _doctorId;
  //   doctors[_doctorId].password = _password;
  //   doctorArray.push(_doctorId);
  //   emit DoctorAdded(_doctorId);
  // }

  // ---------------------------------------------//

  // // Refer to this functions afterwards
  // function addRecord(string memory _cid, string _patientName, string _doctorName, string memory symptoms, string memory diagnostic) public senderIsDoctor patientExists(_patientId) {
  //   Record memory record = Record(_cid, _patientName, _doctorName, symptoms, diagnostic, block.timestamp);
  //   patients[_patientId].records.push(record);

  //   // emit RecordAdded(_cid, _patientId, _doctorId);
  // } 

  function addRecord(string memory _cid, address _patientId, string memory _patientName, string memory _doctorName, string memory symptoms, string memory diagnostic) public {
    Record memory record = Record(_cid, _patientName, _doctorName, symptoms, diagnostic, block.timestamp);
    patients[_patientId].records.push(record);
    patients[_patientId].id = _patientId;
    patientArray.push(_patientId);

    // emit RecordAdded(_cid, _patientId, _doctorId);
  } 

  function getRecords(address _patientId) public view  patientExists(_patientId) returns (Record[] memory) {
    return patients[_patientId].records;
  } 

  // function getSenderRole() public view returns (string memory) {
  //   if (doctors[msg.sender].id == msg.sender) {
  //     return "doctor";
  //   } else if (patients[msg.sender].id == msg.sender) {
  //     return "patient";
  //   } else {
  //     return "unknown";
  //   }
  // }


